import { cart_add,remove_cart } from './types';

export const AddCart=({cart})=>async dispatch=>{

    try{
        dispatch({
            type:cart_add,
            payload:cart,
        })
     console.log(cart)
    }catch (err) {
    }
  }

export const RemoveCart=({id})=>async dispatch=>{

    try{
        dispatch({
            type:remove_add,
            payload:id,
        })
     console.log(id)
    }catch (err) {
    }
  }
